import React, { Component } from "react";
import Flexbox from "flexbox-react";
import Navbar from "react-bootstrap";

import Weblink from "./WebLink.js";

export default function NavBar() {
  return (
    <Navbar className="navbar fixed-top navbar-toggleable-sm navbar-inverse bg-inverse">
    <div className="container">
      
      <button className="navbar-toggler navbar-toggler-right" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
        <span className="navbar-toggler-icon"></span>
      </button>
      
      <a className="navbar-brand" href="#">Smooth</a>
      <div className="collapse navbar-collapse" id="navbarNav">
        
        <ul className="navbar-Navbar">          
          <li className="Navbar-item active">
            <a className="Navbar-link scroll" href="#top">Home</a>
          </li>
          <li className="Navbar-item">
            <a className="Navbar-link scroll" href="#features">Features</a>
          </li>
          <li className="Navbar-item">
            <a className="Navbar-link scroll" href="#pricing">Pricing</a>
          </li>          
        </ul>
        
      </div>
    </div>
  </Navbar>
  )
}

